svg.script:
	
			
			var endInterval = 0
			
			var rot1_1 = 0, rot1_2 = 30, rot1_3 = -10, rot1_4 = -5;
			var rot2_1 = 0, rot2_2 = -20, rot2_3 = 0, rot2_4 = 20;	
			var rot3_1 = 0, rot3_2 = -10, rot3_3 = 0, rot3_4 = -70;	
			var rot4_1 = 0, rot4_2 = -5, rot4_3 = 0, rot4_4 = 10;	
			var rot5_1 = 0, rot5_2 = 90, rot5_3 = 0, rot5_4 = 0, rot5_5 = 150;	
			var rot6_1 = 95, rot6_2 = 190, rot6_3 = 95, rot6_4 = 245;	
			
			var sand_1 = 0, sand_2 = 0;
			
			var fast_ = 50, fast_2 = 50, fast_3 = 50, fast_4 = 50, fast_5 = 50, fast_6 = 50, fast_7 = 50;

			var rota = 0;
			
			var endAnimation = false;
			
			
			var aniPoints = 0;
			
			var main_obj = document.getElementById("main_obj");
			var leaver_1 = document.getElementById("leaver_1");
			var leaver_2 = document.getElementById("leaver_2");
			var leaver_3 = document.getElementById("leaver_3");
			var leaver_4 = document.getElementById("leaver_4");
			var leaver_5 = document.getElementById("leaver_5");			
			var leaver_6 = document.getElementById("thread");
			var liftBlock = document.getElementById("liftBlock");
			
			
			
			var sand_flow = document.getElementById("maskObj");
			
			
			var obj3 = document.getElementById("obj3");

			var checkAni = false;
			
			var Interval = null;
			
			function startAnimation() {
				if(Interval == null) {
					Interval = setInterval(animate, 50);
				}
			}
			function stopAnimation() {
				if(Interval != null){
					clearInterval(Interval);
					Interval = null;
				}
			}					
			function animate() {		
				
				rota = rota + 1;
				
				aniPoints = aniPoints +1;
				
				if(aniPoints > 10 && aniPoints < 40){
					endAnimation = false;
					fast_ += (2 - fast_)/10;
					rot1_1 += (rot1_2 - rot1_1)/fast_;				
					rot2_1 += (rot2_2 - rot2_1)/fast_;
					rot3_1 += (rot3_2 - rot3_1)/fast_;	
					rot4_1 += (rot4_2 - rot4_1)/fast_;	
					leaver_1.setAttribute("transform",  "rotate("+ rot1_1 +" 14  200)");
					leaver_2.setAttribute("transform",  "rotate("+ rot2_1 +" 38  80)");
					leaver_3.setAttribute("transform",  "rotate("+ rot3_1 +" 147  26)");
					leaver_4.setAttribute("transform",  "rotate("+ rot4_1 +" 182  63)");				
					}
				
				if(aniPoints > 30 && aniPoints < 70){
					fast_2 += (2 - fast_2)/10;	
					rot4_1 += (rot4_3 - rot4_1)/fast_2;					
					leaver_4.setAttribute("transform",  "rotate("+ rot4_1 +" 182  63)");					
					}
				
				if(aniPoints > 70 && aniPoints < 100){
					fast_3 += (2 - fast_3)/10;	
					rot5_1 += (rot5_2 - rot5_1)/fast_3;	
					rot6_1 += (rot6_2 - rot6_1)/fast_3;
					leaver_5.setAttribute("transform",  "translate( 0 ,"+ rot5_1 +")");					
					leaver_6.setAttribute("y2",  rot6_1);
					}
				
				if(aniPoints > 100 && aniPoints < 102){
					liftBlock.setAttribute("visibility",  "hidden");
					}
				
				if(aniPoints > 115 && aniPoints < 190){
					fast_4 += (2 - fast_4)/10;
					rot5_1 += (rot5_3 - rot5_1)/fast_4;	
					rot6_1 += (rot6_3 - rot6_1)/fast_4;
					leaver_5.setAttribute("transform",  "translate( 0 ,"+ rot5_1 +")");
					leaver_6.setAttribute("y2",  rot6_1);
					}
				
				
				if(aniPoints > 190 && aniPoints < 230){
					fast_5 += (2 - fast_5)/10;
					rot1_1 += (rot1_3 - rot1_1)/fast_5;				
					rot2_1 += (rot2_3 - rot2_1)/fast_5;
					rot3_1 += (rot3_3 - rot3_1)/fast_5;	
					rot4_1 += (rot4_4 - rot4_1)/fast_5;	
					rot5_1 += (rot5_4 - rot5_1)/fast_3;	
					leaver_1.setAttribute("transform",  "rotate("+ rot1_1 +" 14  200)");
					leaver_2.setAttribute("transform",  "rotate("+ rot2_1 +" 38  80)");
					leaver_3.setAttribute("transform",  "rotate("+ rot3_1 +" 147  26)");
					leaver_4.setAttribute("transform",  "rotate("+ rot4_1 +" 182  63)");
					}
				
				if(aniPoints > 240 && aniPoints < 280){
					fast_6 += (2 - fast_6)/10;	
					rot5_1 += (rot5_5 - rot5_1)/fast_6;	
					rot4_1 += (rot4_1 - rot4_1)/fast_6;						
					leaver_4.setAttribute("transform",  "rotate("+rot4_1+" 182 50)");
					leaver_5.setAttribute("transform",  "translate(2, "+rot5_1+")");
					rot6_1 += (rot6_4 - rot6_1)/fast_6;
					leaver_6.setAttribute("y2",  rot6_1);
					}
				
				
				if(aniPoints > 280 && aniPoints < 282){
					liftBlock.setAttribute("visibility",  "visible");
					}				
				
				if(aniPoints > 300 && aniPoints < 340){
					fast_7 += (2 - fast_7)/10;
					rot5_1 += (rot5_3 - rot5_1)/fast_7;	
					rot4_1 += (rot4_1 - rot4_1)/fast_7;	
					leaver_4.setAttribute("transform",  "rotate("+rot4_1+" 182 50)");
					leaver_5.setAttribute("transform",  "translate(0, "+rot5_1+")");
					
					rot6_1 += (rot6_3 - rot6_1)/fast_7;
					leaver_6.setAttribute("y2",  rot6_1);					
					}	
				
				
				if(aniPoints > 340 && !endAnimation){					
					endAnimation = true;
					aniPoints = 0;
					fast_ = 50, fast_2 = 50, fast_3 = 50, fast_4 = 50, fast_5 = 50, fast_6 = 50, fast_7 = 50;
					}
				
			}

			main_obj.setAttribute("transform",  "translate( 100, 40)");
			
				
			startAnimation();
